import { useState, useEffect } from 'react';

const Results = () => {
  const [results, setResults] = useState(null);

  useEffect(() => {
    const handleResults = (event) => {
      setResults(event.detail);
    };

    window.addEventListener('analysisResults', handleResults);
    return () => window.removeEventListener('analysisResults', handleResults);
  }, []);

  if (!results) {
    return null;
  }

  return (
    <div className="results-container">
      <h2>Analysis Results</h2>
      <div className="results-grid">
        <div>
          <h3>Mean Heart Rate</h3>
          <p>{results.mean} bpm</p>
        </div>
        <div>
          <h3>Minimum Heart Rate</h3>
          <p>{results.min_hr} bpm at {results.min.time} ms</p>
        </div>
        <div>
          <h3>Maximum Heart Rate</h3>
          <p>{results.max_hr} bpm at {results.max.time} ms</p>
        </div>
        {results.recording_date && (
          <div>
            <h3>Recording Date</h3>
            <p>{new Date(results.recording_date).toLocaleString()}</p>
          </div>
        )}
      </div>
    </div>
  );
};

export default Results;
